import React from "react";
import { connect } from "react-redux";
import { fetchStreamns } from "../../actions";

class StreamList extends React.Component {
  render(props) {
    return <div>StreamList</div>;
  }
}

export default connect(
  null,
  { fetchStreamns }
)(StreamList);
